import React from 'react';
import Navbar from '../Components/NavigationBar/NavigationBar';
import Header from '../Components/Header/Header';
import AttractionCard from '../Components/AttractionCard/AttractionCard';
import './AttractionList.css';

const attractions = [
  {
    name: 'Bran Castle',
    location: 'Bran, Brasov',
    description:
      'Bran Castle is a national monument and landmark in Romania. The fortress is situated on the border between Transylvania and Wallachia.',
    imageUrl: 'https://picsum.photos/id/1018/500/300',
  },
  {
    name: 'Palace of Culture',
    location: 'Iasi',
    description:
      'Palace of Culture is a palace located in Iasi, Romania. The building served as Administrative Palace and now it hosts four museums.',
    imageUrl: 'https://picsum.photos/id/1015/500/300',
  },
  {
    name: 'The Sphinx',
    location: 'Bucegi Mountains, Romania',
    description:
      'The Sphinx is a natural rock formation located in the Bucegi Mountains of Romania. It is named after its resemblance to the Egyptian Sphinx.',
    imageUrl: 'https://picsum.photos/id/1011/500/300',
  },
  {
    name: 'Peles Castle',
    location: 'Sinaia, Prahova',
    description:
      'Peles Castle is a Neo-Renaissance castle in the Carpathian Mountains, near Sinaia, in Prahova County, Romania, on an existing medieval route linking Transylvania and Wallachia.',
    imageUrl: 'https://picsum.photos/id/1019/500/300',
  },
  {
    name: 'The Merry Cemetery',
    location: 'Sapanta, Maramures',
    description:
      'The Merry Cemetery is a cemetery in the village of Sapanta, Maramures county, Romania. It is famous for its colourful tombstones with naive paintings and popular poems.',
    imageUrl: 'https://picsum.photos/id/1022/500/300',
  },
];

const AttractionList = () => {
  return (
    <div>
      <Navbar />
      <Header type="List" title="Romania's Attractions" />
      <div className="AttractionListContainer">
        {attractions.map((attraction) => (
          <AttractionCard key={attraction.name} attraction={attraction} />
        ))}
      </div>
    </div>
  );
};

export default AttractionList;
